The function responsible for loading initrd is implemented as load_initrd. It takes two arguments: the memory allocated for the Guest and a mutable reference to the File structure representing the opened initrd file (implementing Read and Seek traits). fn load_initrd<F>( vm_memory: &memory::GuestMemoryMmap, image: &mut F,
) -> std::result::Result<InitrdConfig, StartVmError>
where F: Read + Seek { let size: usize; // Get image size match image.seek(SeekFrom::End(0)) { Err(e) => return Err(StartVmError::InitrdRead(e)), Ok(0) => { return Err(StartVmError::InitrdRead(io::Error::new( io::ErrorKind::InvalidData, "Initrd image seek returned a size of zero", ))) } Ok(s) => size = s as usize, }; // Go back to the image start image.seek(SeekFrom::Start(0)).map_err(StartVmError::InitrdRead)?; // Get the target address let address = arch::initrd_load_addr(vm_memory, size) .map_err(|_| StartVmError::InitrdLoad)?; // Load the image into memory // - read_from is defined as trait methods of Bytes<A> // and GuestMemoryMmap implements this trait. vm_memory .read_from(GuestAddress(address), image, size) .map_err(|_| StartVmError::InitrdLoad)?; Ok(InitrdConfig{ address: GuestAddress(address), size, })
} The function performs the following steps: Retrieves the size of the initrd by seeking to the end of the file and then returning to the start. Calculates the target address in Guest memory where the initrd should be loaded. Loads the contents of the initrd file into the specified Guest memory address. Returns an InitrdConfig structure containing the Guest memory address and size of the loaded initrd. Once the initrd is loaded into memory, we need to configure the kernel's setup header. This header information is defined by the Boot Protocol . In ToyVMM, these settings are primarily configured in the configure_system function. The table below outlines the relevant settings, which are documented in the Boot Protocol: Offset/Size Name Meaning ToyVMM value 01FE/2 boot_flag 0xAA55 magic number 0xaa55 0202/4 header Magic signature "HdrS" (0x53726448) 0x5372_6448 0210/1 type_of_loader Boot loader identifier 0xff (undefined) 0218/4 ramdisk_image initrd load address (set by boot loader) GUEST ADDRESS OF INITRD 021C/4 ramdisk_size initrd size (set by boot loader) SIZE OF INITRD 0228/4 cmd_line_ptr 32-bit pointer to the kernel command line 0x20000 0230/4 kernel_alignment Physical addr alignment required for kernel 0x0100_0000 0238/4 cmdline_size Maximum size of the kernel command line SIZE OF CMDLINE STRING These values are written to Guest memory starting at address 0x7000. The 0x7000 address is also stored in RSI, a vCPU register, for reference during VM startup. For details on vCPU register setup, please refer to Setup registers of vCPU .

