Configuring the E820 for the Guest OS allows reporting of available memory regions to the OS and BootLoader. The settings for this are aligned with the implementation in Firecracker. The following code illustrates how the E820 entries are added based on the Guest memory configuration: add_e820_entry(&mut params, 0, EBDA_START, E820_RAM)?;
let first_addr_past_32bits = GuestAddress(FIRST_ADDR_PAST_32BITS);
let end_32bit_gap_start = GuestAddress(MMIO_MEM_START);
let himem_start = GuestAddress(HIGH_MEMORY_START);
let last_addr = guest_mem.last_addr();
if last_addr < end_32bit_gap_start { add_e820_entry( &mut params, himem_start.raw_value() as u64, last_addr.unchecked_offset_from(himem_start) as u64 + 1, E820_RAM)?;
} else { add_e820_entry( &mut params, himem_start.raw_value(), end_32bit_gap_start.unchecked_offset_from(himem_start), E820_RAM)?; if last_addr > first_addr_past_32bits { add_e820_entry( &mut params, first_addr_past_32bits.raw_value(), last_addr.unchecked_offset_from(first_addr_past_32bits) + 1, E820_RAM)?; }
} It would be better to understand the design of the entire address space for the Guest VM, considering the code for starting a Guest VM in ToyVMM. Therefore, I'll list the current memory design for the Guest in the following table. Please note that this information may change in the future. Guest Address Contents Note 0x0 - 0x9FBFF E820 0x7000 - 0x7FFF Boot Params (Header) ZERO_PAGE_START(=0x7000) 0x9000 - 0x9FFF PML4 Now only 1 entry (8byte), maybe expand later 0xA000 - 0xAFFF PDPTE Now only 1 entry (8byte), maybe expand later 0xB000 - 0xBFFF PDE Now 512 entry (4096byte) 0x20000 - CMDLINE Size depends on cmdline parameter len 0x100000 HIGH_MEMORY_START 0x100000 - 0x7FFFFFF E820 0x100000 - 0x20E3000 vmlinux.bin Size depends on vmlinux.bin's size 0x6612000 - 0x7FFF834 initrd.img Size depends on initrd.img's size 0x7FFFFFF GuestMemory last address based on (128 << 20 = 128MB = 0x8000000) - 1 0xD0000000 MMIO_MEM_START（4GB - 768MB） 0xD0000000 - 0xFFFFFFFF MMIO_MEM_START - FIRST_ADDR_PAST_32BIT 0x100000000 FIRST_ADDR_PAST_32BIT (4GB~) Upon examining the code, you can see that the address range that is designed independently of the GuestMemory size (roughly 0x0 ~ HIGH_MEMORY_START) is commonly registered as "Usable" in the E820, ranging from 0 to EBDA_START (0x9FBFF). Subsequently, the range registered in the E820 changes depending on how much GuestMemory is allocated. In the current implementation, the GuestMemory is set to reserve 128MB of memory by default, so the Guest Memory ranges from 0x0 to 0x7FF_FFFF. In this range, vmlnux.bin content and initrd.img are mapped. In other words, the logic guest_mem.last_addr() = 0x7FF_FFFF < 0xD000_0000 = end_32bit_gap_start applies, so the range HIGH_MEMORY_START ~ guest_mem.last_addr() is additionally registered. In the future, as you expand, if the GuestMemory size exceeds 4GB, you will register the ranges 0x10_0000 ~ 0xD000_0000 and 0x1_000_0000 ~ guest_mem.last_addr(). You will be able to confirm the console output when starting the VM shortly. Here, I've provided part of the output to show that the E820 entries you configured are registered: [ 0.000000] e820: BIOS-provided physical RAM map:
[ 0.000000] BIOS-e820: [mem 0x0000000000000000-0x000000000009fbff] usable
[ 0.000000] BIOS-e820: [mem 0x0000000000100000-0x0000000007ffffff] usable

