In ToyVMM, the implementation of Virtqueues is located in queue.rs. The concrete addresses of the Descriptor Table, Available Ring, and Used Ring in guest memory are configured through interactions with the guest-side Device Driver during the guest VM startup. While we'll delve into this exchange as we peek into actual I/O requests from the guest, for now, let's focus on this fact. ToyVMM needs to perform address accesses based on the specific starting addresses and Virtio specifications. In essence, it operates on a per-descriptor basis (where each descriptor points to the address of the actual data). During data processing, it updates the Available Ring and Used Ring. Now, let's explore the code. The Queue structure in ToyVMM represents a Virtqueue and is defined as follows: #[derive(Clone)]
/// A virtio queue's parameters
pub struct Queue { /// The maximal size in elements offered by the device max_size: u16, /// The queue size in elements the driver selected pub size: u16, /// Indicates if the queue is finished with configuration pub ready: bool, /// Guest physical address of descriptor table pub desc_table: GuestAddress, /// Guest physical address of the available ring pub avail_ring: GuestAddress, /// Guest physical address of the used ring pub used_ring: GuestAddress, next_avail: Wrapping<u16>, next_used: Wrapping<u16>,
} In this structure, you can see the definitions for the Descriptor Table, Available Ring, and Used Ring, which represent the specific addresses in guest memory. These addresses are initialized during interactions with the guest's Device Driver, as mentioned earlier. From ToyVMM's perspective, these are merely physical memory addresses belonging to the guest, and ToyVMM accesses them based on Virtio specifications. Now, let's delve into address access using the code. ToyVMM abstracts the sequence of operations to get Descriptor from the state of Available Ring is hiddden as Virtqueue iteration, and in actual device implementations that utilize Virtqueues, you will find code structured like this: // queue: 'Queue' struct
// desc_chain: 'DescriptorChain' struct
for desc_chain in queue.iter(mem) { // 'desc_chain' contains the 'addr,' 'len,' 'flags,' and 'next' values of the descriptor // Behind the iteration, data related to 'queue.avail_ring' is adjusted.
} Behind the scenes of this iteration, let's explain what's happening. First, the iter function is implemented in the Queue structure, and it creates an AvailIter structure. To create this AvailIter, it fetches the latest idx in the Available Ring from the GuestMemory and the avail_ring's starting address. /// A consuming iterator over all available descriptor chain heads offered by the driver
pub fn iter<'a, 'b>(&'b mut self, mem: &'a GuestMemoryMmap) -> AvailIter<'a, 'b> { ... // validation codes let queue_size = self.actual_size(); let avail_ring = self.avail_ring; // Access the 'idx' fields of available ring // skip 2 bytes (= u16 / 'flags' member) from avail_ring address // and get 2 bytes (= u16 / 'idx' member representing the newest index of avail_ring) from that address. let index_addr = mem.checked_offset(avail_ring, 2).unwrap(); let last_index: u16 = mem.read_obj(index_addr).unwrap(); AvailIter { mem, desc_table: self.desc_table, avail_ring: self.avail_ring, next_index: self.next_avail, last_index: Wrapping(last_index), queue_size, next_avail: &mut self.next_avail, }
} As you can see, the iter function returns an AvailIter. Inside the next function of AvailIter, if self.next_index equals self.last_index, it returns None, indicating the end of iteration. The next_index tracks the processed index values. Inside the next function, the element pointed to by self.next_index in the Available Ring (which corresponds to a descriptor index) is retrieved. The DescriptorChain::checked_new function is called using this retrieved value, and the result value is returned as the element during iteration. The checked_new function calculates the address of the element pointed to by the index value and accesses it, extracting information like the addr, len, flags, and next of the descriptor. Finally, it constructs a DescriptorChain structure with this information. fn checked_new( mem: &GuestMemoryMmap, desc_table: GuestAddress, queue_size: u16, index: u16,
) -> Option<DescriptorChain> { if index >= queue_size { return None; } // The size of each element of the descriptor table is 16 bytes // - le64 addr = 8 bytes // - le32 len = 4 bytes // - le16 flags = 2 bytes // - le16 next = 2 bytes // So, the calculation of the offset of the address // indicated by desc_index is 'index * 16' let desc_head = match mem.checked_offset(desc_table, (index as usize) * 16) { Some(a) => a, None => return None, }; // These reads can't fail unless Guest memory is hopelessly broken let addr = GuestAddress(mem.read_obj(desc_head).unwrap()); mem.checked_offset(desc_head, 16)?; let len = mem.read_obj(desc_head.unchecked_add(8)).unwrap(); let flags: u16 = mem.read_obj(desc_head.unchecked_add(12)).unwrap(); let next: u16 = mem.read_obj(desc_head.unchecked_add(14)).unwrap(); let chain = DescriptorChain { mem, desc_table, queue_size, ttl: queue_size, index, addr, len, flags, next, }; if chain.is_valid() { Some(chain) } else { None }
} Since the next function returns a DescriptorChain, you access the descriptor's information when processing within the loop by accessing the relevant members of the DescriptorChain structure. Although I have not mentioned it much so far, Used Ring also needs to be updated on the host side. However, this is not a difficult process and can be implemented by defining the following functions and calling them as necessary. /// Puts an available descriptor head into the used ring for use by the guest
pub fn add_used(&mut self, mem: &GuestMemoryMmap, desc_index: u16, len: u32) { if desc_index >= self.actual_size() { // TODO error return; } let used_ring = self.used_ring; let next_used = (self.next_used.0 % self.actual_size()) as u64; // virtq_used structure has 4 byte entry before `ring` fields, so skip 4 byte. // And each ring entry has 8 bytes, so skip 8 * index. let used_elem = used_ring.unchecked_add(4 + next_used * 8); // write the descriptor index to virtq_used_elem.id mem.write_obj(desc_index, used_elem).unwrap(); // write the data length to the virtq_used_elem.len mem.write_obj(len, used_elem.unchecked_add(4)).unwrap(); // increment the used index that is the last processed in host side. self.next_used += Wrapping(1); // This fence ensures all descriptor writes are visible before the index update is. fence(Ordering::Release); mem.write_obj(self.next_used.0, used_ring.unchecked_add(2)) .unwrap(); Please remember this underlying mechanism as it forms the basis for the actual I/O implementation in the virtio-net and virtio-blk devices, which we will explain in the following sections.
